        Phase1,
        Phase2,
        Phase3,
        Ended
    }
    IERC20 token;

    uint256 public startUTCDateTime;
    uint256 public endUTCDateTime;
    uint256 public phaseCap;
    uint256 public rate; // tokens per bnb
    uint256 public saleCount; // total token sold
